Doch das ist er! 

Denn ihr beide teilt genau diesen einen Augenblick. Den Moment, der niemals wiederkommen wird. 

Weißt du eigentlich, wie unendlich wertvoll es ist, zu zweit im Hier und Jetzt zu sein? 

Hab ein tolles Wochenende mit einzigartigen Momenten, besonderen Begegnungen und so schönen Augenblicken, dass du dir wünschst, sie mögen für immer verweilen.

Deine Daniela

